function ApiTest() {
   const [data,setData]= useState([])
  // const classes = useStyles()   
   useEffect( ()=>{
    axios.get('https://tomestry.com/api/merchandise/')
    .then((res)=>{setData(res.data)})
    .catch((error)=>{console.log("unable to load")})},[])

   console.log(data)
  return (
    <div>
    <table border="2px solid red">
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Mobile No.</th>
          <th>Mode</th>
        </tr>
    {data.map((e)=>{return(

        <tr>
          <td>{e.id}</td>
          <td>{e.vendor}</td>
          <td>{e.phone_in_shop}</td>
          <td>{e.location}</td>
        </tr>





    )})}
    </table>


    </div>
  )
}

export default ApiTest;
